// frontend/src/components/PoliceSearchForm.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PoliceSearchForm = ({ token }) => {
  const [query, setQuery] = useState('');
  const [resultados, setResultados] = useState([]);

  const handleSearch = async () => {
    try {
      const res = await axios.get(`http://localhost:5000/api/objetos?q=${query}`, {
        headers: { Authorization: token }
      });
      setResultados(res.data);
    } catch (err) {
      alert('Error al buscar');
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/objetos/${id}`, {
        headers: { Authorization: token }
      });
      setResultados(resultados.filter((item) => item._id !== id));
    } catch (err) {
      alert('Error al eliminar');
    }
  };

  return (
    <div className="space-y-4">
      <input value={query} onChange={(e) => setQuery(e.target.value)} placeholder="Buscar..." className="border p-2 w-full" />
      <button onClick={handleSearch} className="bg-blue-500 text-white px-4 py-2 rounded">Buscar</button>
      <ul className="space-y-2">
        {resultados.map((item) => (
          <li key={item._id} className="border p-2 flex justify-between">
            <span>{item.elemento} - {item.marca} - {item.modelo}</span>
            <button onClick={() => handleDelete(item._id)} className="bg-red-500 text-white px-2 py-1 rounded">Eliminar</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PoliceSearchForm;
